22996171:
ஓர் நவீன வெடிபொதி கீழ்வருபவற்றை கொண்டிருக்கும்:
 1. எறியமாக, தோட்டா;
 2.பொதியுறை, அனைத்து பொருட்களையும் ஒன்றாக பிணைத்து வைத்திருப்பது;
 3.உந்துபொருள், உதாரணமாக வெடிமருந்து அல்லது புகையற்ற மருந்து;
 4. விளிம்பு, இதைபிடித்து தான் சுட்ட பொதியுறை, அறையில் இருந்து நீக்கப்படும்;
 5. எரியூட்டி  , உந்துபொருளை தீமூட்டும்.

7452653:
சுசோவின் நிலக்குறியீடுகள் — 
மேல் இடது: அடக்கமான ஆட்சியர் தோட்டம்; 
மேல் வலது: புலிக்குன்றிலிருக்கும் யுன்யான் பகோடா; 
நடு: ஜிஞ்ஜி ஏரியின் வானளாவி; 
கீழ் இடது: இரவில் சாங்மென் வாயில்; 
கீழ் வலது: ஷான்டாங் கால்வாய்

2199010:
மேலிருந்து வலஞ்சுழியாக:
கலட்டாவிற்கும் செரக்லியோ முனைக்கும்
நடுவில் உள்ள தங்க ஹோர்ன்; மசுலாக் நிதியியல் மாவட்டம்;
இசுடிக்லல் அவெனியூ;
குலேலி இராணுவ உயர்நிலைப் பாடசாலை;
மற்றும் சுல்தான் அஹமட் பள்ளிவாசல்

